@import "../../../styles.scss";

.da-progress-button-single {
    font-family: $font;
    position: relative;
    display: flex;
    flex-direction: column;
    align-items: center;

    button {
        border: none;
        min-height: 22px;
        min-width: 22px;
        color: $button-base-color;
        display: flex;
        flex-direction: column;
        align-items: center;
        font-size: 12px;
        font-weight: 300;
        font-family: $font;
        transition: all 0.4s ease-in-out 0s, visibility 0s;
        background: transparent;
        cursor: pointer;

        &.disabled {
            cursor: default;
            pointer-events: none;

            .da-progress-button-icon {
                opacity: 0.2;
            }

            .da-progress-button-state-circle {
                display: none;
            }
        }

        .da-progress-button-label {
            width: 100%;
            text-align: center;
            display: block;
            white-space: nowrap;
            transition: all 0.4s ease-in-out 0s, visibility 0s;
        }
        .da-progress-button-state-wrapper {
            position: relative;
            width: 50px;

            .da-progress-button-state {
                position: absolute;
                right: 8px;
                bottom: 0;

                .da-progress-button-state-icon {
                    font-size: 12px;
                    fill: $button-base-color;
                }

                .da-progress-button-state-circle {
                    width: 14px;
                    height: 14px;
                    border-radius: 14px;
                    margin-left: -10px;
                    background-color: $tab-background;
                    box-shadow: 0 3px 5px $shadow-base-color;
                    transition: all 0.4s ease-in-out 0s, visibility 0s;

                    &.green {
                        background-color: $success-color;
                    }
                    &.yellow {
                        background-color: $attention-color;
                    }
                    &.red {
                        background-color: $warning-base-color;
                    }
                }
            }
            .da-progress-button-icon {
                font-size: 21px;
                display: inline-block;
                width: 25px;
                color: $button-base-color;
                fill: $button-base-color;
                transition: all 0.4s ease-in-out 0s, visibility 0s;

                &.green {
                    color: $success-color;
                    fill: $success-color;
                }

                &.red {
                    color: $warning-base-color;
                    fill: $warning-base-color;
                }
            }
        }
        &:hover {
            .da-progress-button-state-wrapper .da-progress-button-icon {
                font-size: 24px;
                width: 30px;
            }

            .da-progress-button-label {
                font-size: 14px;
            }

            .da-progress-button-state-wrapper .da-progress-button-state .da-progress-button-state-circle {
                width: 16px;
                height: 16px;
            }

            +.da-progress-button-state-label {
                visibility: visible;
            }
        }
    }
    .da-progress-button-state-label {
        visibility: hidden;
        color: $t1-secondary-color;
        background-color: $button-base-color;
        border-radius: 10px;
        white-space: nowrap;
        font-size: 12px;
        font-weight: 300;
        padding: 3px 10px;
        text-align: center;
        position: absolute;
        bottom: -25px;
        transition: all 0.4s ease-in-out 0s, visibility 0s;
    }
}

