                background-color: $success-color;
                color: #fff;
                fill: #fff;
                box-shadow: 0 3px 5px $shadow-base-color;
                z-index: 2;
            }

            &:checked + .da-switch-slider.light {
                background-color: $success-color;
                color: #fff;
                fill: #fff;
                box-shadow: 0 3px 5px $shadow-secondary-color;
                z-index: 2;
            }

        }

        .da-switch-label {
            position: relative;
            white-space: nowrap;
            pointer-events: none;
            left: 20px;
            z-index: 1;
        }
        .da-switch-icon {
            font-size: 1.5rem;
            z-index: 1;
            color: #fff;
            fill: #fff;
            margin-right: 10px;
            margin-top: 5px;
            pointer-events: none;
        }

        .da-switch-slider {
            position: absolute;
            cursor: pointer;
            top: 0;
            bottom: 0;
            height: 42px;
            width: 100%;
            color: $t1-base-color;
            fill: $t1-base-color;
            border-radius: 21px;
            z-index: 1;
            display: flex;
            align-items: center;
            justify-content: space-between;
            -webkit-transition: 0.4s;
            transition: 0.4s;

            &.bottom {
                right: 0px;
                left: 0px;
                width: 200px;
            }

            &.top {
                left: 0px;
                right: 0px;
                width: 200px;
            }

            &:before {
                position: absolute;
                content: "";
                height: 42px;
                width: 200%;
                border-radius: 21px;
                -webkit-transition: 0.4s;
                transition: 0.4s;
            }

            &.top:hover {
                background-color: #ccc;
                box-shadow: 0 3px 5px $shadow-base-color;
                color: #fff;
                fill: #fff;


            }

            &.bottom:hover {
                background-color: #ccc;
                box-shadow: 0 3px 5px $shadow-base-color;
                color: #fff;
                fill: #fff;
            }
        }
    }
}

